import { Input } from '@mui/material';
import swal from '@sweetalert/with-react';


export const forgetPsswrd = () =>{
    let token
    swal({
        buttons: {
          cancel: "Codigo de recuperacion via email",
          ok:"Preguntas secretas"
        },
        content: (
            <div>
            <h1>¿Has olvidado tu contraseña?</h1>
            <p>Selecciona una opción de recuperación</p>
        </div>
        )
    }).then((a)=>{
        if (a) {
            swal("Preguntas", {
              icon: "success",
            });
          } else {
            swal({
                button:{
                    ok:{
                        text:"Confirmar",
                        value:token
                    }
                },
                content:
                <div>
                    <h1>Ingrese el PIN proporcionado en su correo electronico</h1>
                    token = <Input></Input>
                </div>
            }
            );
          }
    })
}
export const click2 = ()=>{
    alert("Click2")
}
